 import React from "react";
 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';

 const Mainproduct = () => {


const listItem=product_cart.map((item)=>
<Box className="body" sx={{display:"flex",
    justifycontent: "center",
    alignItems:"center", backgroundColor:"black"}} >
<Box className="cart" key={item.id} sx={{backgroundColor:"white"}}>
<Box >
<img src={item.thumb} alt="Logo" style={{ height: '100px', margin: '10px', flexGrow: 1 }} />
</Box>

<div classname="card_header">
<h2>{item.name}</h2>
<p>{item.description}</p>
<p className="price"><span>{item.price}</span></p>
<div className="consult item"></div>

</div>

    </Box>
    </Box>
 );




return (
  <Box
    style={{
      marginTop: '0',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: 'white',
    }}
  >
    <Box
      style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        maxWidth: '1580px',
        overflow: 'auto',
      }}
    >
      <Box className="main_content" sx={{display:"flex",
    justifycontent: "center",
    alignItems:"center"}}  >
          {listItem}
      </Box>
     
      
    </Box>
  </Box>
);
}

 export default  Mainproduct;
